import React, { useEffect, useState } from 'react';

function App() {
	const [title, setTitle] = useState('Title!');

	useEffect(() => {
		setTitle('Updated po Effect');
	}, []);

	return (
		<div>
			<h1>{title}</h1>
		</div>
	);
}

export default App;
